@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<app-homenavbar></app-homenavbar>
<div class="herotext">
    <h3>Jio DigiGv Team Presents</h3>
    <h1>Video KYC</h1>
    <p class="description">Video KYC is an additional mode through which users can complete the KYC for their accounts within just a few minutes. During the process, customer's KYC documents are verified and their signatures are recorded through a video call with a bank officer, thus doing away with the need of physically visiting a bank branch.</p>
    <hr class="genericdivider">
</div>


